// binarySearch function:
// Input is an array of sorted numbers
// Target is a number we are looking to find
// return True if the number is found, False otherwise
// A linear search takes O(n) time to execute, but we can do better.  A proper binary search takes O(log n) time -- which is much better.
// We may want to get larget lists to test with: try https://www.random.org/integer-sets/

// [1, 3, 5, 8, 9], 9: true
// [1, 3, 5, 8, 9], 2: false


function binarySearch(input, target, upper_bound = input.length, lower_bound = 0){

    // If the lower bound and upper bound have met (or crossed), the value isn't there
    if (upper_bound <= lower_bound){
        return false;
    }
    
    // Otherwise, we'll start at the middle value between the two...
    var middle_value = Math.floor((upper_bound + lower_bound) / 2);
    
    // If it's the target, return true
    if(input[middle_value] == target){
        return true;
    }

    // If it isn't the target, update the bounds appropriately and call the function again.
    if(input[middle_value] < target){
        lower_bound = middle_value + 1;
    }
    else if(input[middle_value] > target){
        upper_bound = middle_value;
    }

    return binarySearch(input, target, upper_bound, lower_bound);
}


function non_binary_search(input, target){
    for(let i=0; i<input.length; i++){
        if (input[i] == target){
            return true;
        }
    }
    return false;
}


